import React from "react";

import Header from "./Header";
import Order from "./Order";
import Inventory from "./Inventory.js";


class App extends React.Component {

  render() {
    return (
      <div className="catch-of-the-day">
	<div className="menu">
	  <Header
	  tagline="WEs is Cool"/>
	</div>
	<Order /> 
	<Inventory />
      </div>
      
    );
  };
  
};

export default App;
